import {
	Container,
	Button,
	Grid,
	Typography,
	FormControl,
	InputLabel,
	CardContent, Box
  } from "@mui/material";
  import React from "react";
  import { makeStyles } from "@material-ui/core/styles";
  import Paper from "@material-ui/core/Paper";
  import Table from "@material-ui/core/Table";
  import TableBody from "@material-ui/core/TableBody";
  import TableCell from "@material-ui/core/TableCell";
  import TableContainer from "@material-ui/core/TableContainer";
  import TableHead from "@material-ui/core/TableHead";
  import TablePagination from "@material-ui/core/TablePagination";
  import TableRow from "@material-ui/core/TableRow";
  const columns = [
    { id: "name", label: "Name", minWidth: 170 },
    { id: "code", label: "ISO\u00a0Code", minWidth: 100 },
    {
      id: "population",
      label: "Population",
      minWidth: 170,
      align: "right",
      format: value => value.toLocaleString()
    },
    {
      id: "size",
      label: "Size\u00a0(km\u00b2)",
      minWidth: 170,
      align: "right",
      format: value => value.toLocaleString()
    },
    {
      id: "density",
      label: "Density",
      minWidth: 170,
      align: "right",
      format: value => value.toFixed(2)
    }
  ];

  function createData(name, code, population, size) {
    const density = population / size;
    return { name, code, population, size, density };
  }

  const countries = [
    {
      name: "India",
      code: "IN",
      population: 1324171354,
      size: 3287263
    },
    {
      name: "China",
      code: "CN",
      population: 1403500365,
      size: 9596961
    },
    {
      name: "Italy",
      code: "IT",
      population: 60483973,
      size: 301340
    },
    {
      name: "India",
      code: "IN2",
      population: 1324171354,
      size: 3287263
    },
    {
      name: "China",
      code: "CN2",
      population: 1403500365,
      size: 9596961
    },
    {
      name: "Italy",
      code: "IT2",
      population: 60483973,
      size: 301340
    },
    {
      name: "India",
      code: "IN3",
      population: 1324171354,
      size: 3287263
    },
    {
      name: "China",
      code: "CN3",
      population: 1403500365,
      size: 9596961
    },
    {
      name: "Italy",
      code: "IT3",
      population: 60483973,
      size: 301340
    },
    {
      name: "India",
      code: "IN4",
      population: 1324171354,
      size: 3287263
    },
    {
      name: "China",
      code: "CN4",
      population: 1403500365,
      size: 9596961
    },
    {
      name: "Italy",
      code: "IT4",
      population: 60483973,
      size: 301340
    }
  ];

  const rows = countries.map(item =>
    createData(item.name, item.code, item.population, item.size)
  );
  const useStyles = makeStyles({
    root: {
      width: "100%"
    },
    container: {
      maxHeight: 490
    }
  });
const ListPage = () => {
  const classes = useStyles();
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };
	return (
		<Container
			disableGutters={true}
			maxWidth={false}
			sx={{
				backgroundColor: 'rgba(91, 153, 191, 0.1)',
				padding: '58px 64px 41px 32px',
				margin: '0',
			}}
			className='container_Home'
		>
			<Grid
      wrap="nowrap"
      className="home_orders"
      sx={{
        backgroundColor: "#FFFFFF",
        borderRadius: "0px",
        padding: "24px 0 32px 24px",
        boxShadow: "0px 1px 12px rgba(0, 0, 0, 0.06)",
      }}
    >
        <Typography
          sx={{
            fontSize: "32px",
            fontWeight: "700",
            color: "rgba(40, 40, 40, 0.8)",
            textAlign: "center",
          }}
        >
          <h1> Lista Usuarios</h1>
        </Typography>
        <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map(column => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map(row => {
                return (
                  <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                    {columns.map(column => {
                      const value = row[column.id];
                      return (
                        <TableCell key={column.id} align={column.align}>
                          {column.format && typeof value === "number"
                            ? column.format(value)
                            : value}
                        </TableCell>
                      );
                    })}
                  </TableRow>
                );
              })}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[5, 10, 15, 20, 25, 50, 100]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
    </Paper>
      </Grid>
		</Container>
	);
};

export default ListPage;
